import React from 'react';
import PropTypes from 'prop-types';

export default function Layout({ header, leftSidebar, main, rightSidebar, footer }) {
  return (
    <div className="layout">
      {/* Header Section */}
      <header className="layout-header">{header}</header>

      {/* Main Body Section */}
      <div className="layout-body">
        {leftSidebar && <aside className="layout-sidebar layout-sidebar-left">{leftSidebar}</aside>}
        <main className="layout-main">{main}</main>
        {rightSidebar && <aside className="layout-sidebar layout-sidebar-right">{rightSidebar}</aside>}
      </div>

      {/* Footer Section */}
      <footer className="layout-footer">{footer}</footer>
    </div>
  );
}

// PropTypes for component validation
Layout.propTypes = {
  header: PropTypes.node,
  leftSidebar: PropTypes.node,
  main: PropTypes.node.isRequired,
  rightSidebar: PropTypes.node,
  footer: PropTypes.node,
};

// Default Props
Layout.defaultProps = {
  header: null,
  leftSidebar: null,
  rightSidebar: null,
  footer: null,
};
